import React, { useEffect } from 'react';

function GetQuote() {
  useEffect(() => {
    const fetchLocationData = async (query) => {
      try {
        const response = await fetch(
          `https://nominatim.openstreetmap.org/search?q=${query}&format=json`
        );
        const data = await response.json();
        console.log('Location Data:', data);
      } catch (error) {
        console.error('Error fetching location data:', error);
      }
    };

    fetchLocationData('New York');
  }, []);

  return (
    <div className="bg-[#F4F1DE] text-center py-10">
      <h2 className="text-2xl font-bold text-[#4A7A63]">Get a Quote</h2>
      <p className="text-lg text-[#4A7A63] mt-4">
        Fill out the form below, and weâ€™ll provide an estimate for your project.
      </p>
      <form className="mt-6 space-y-4 max-w-md mx-auto">
        {/* Name */}
        <input
          type="text"
          placeholder="Your Name"
          className="w-full px-4 py-2 border border-[#4A7A63] rounded"
        />

        {/* Email */}
        <input
          type="email"
          placeholder="Your Email"
          className="w-full px-4 py-2 border border-[#4A7A63] rounded"
        />

        {/* Phone Number */}
        <input
          type="tel"
          placeholder="Your Phone Number"
          className="w-full px-4 py-2 border border-[#4A7A63] rounded"
        />

        {/* Project Type */}
        <select
          className="w-full px-4 py-2 border border-[#4A7A63] rounded"
          defaultValue=""
        >
          <option value="" disabled>
            Select Project Type
          </option>
          <option value="landscaping">Landscaping</option>
          <option value="irrigation">Irrigation</option>
          <option value="design">Design</option>
          <option value="maintenance">Maintenance</option>
          <option value="other">Other</option>
        </select>

        {/* Project Description */}
        <textarea
          placeholder="Describe your project"
          className="w-full px-4 py-2 border border-[#4A7A63] rounded"
          rows="4"
        ></textarea>

        {/* Square Footage */}
        <input
          type="number"
          placeholder="Square Footage (e.g., 500)"
          className="w-full px-4 py-2 border border-[#4A7A63] rounded"
        />

        <input
          type="text"
          id="location"
          placeholder="Your Address"
          className="w-full px-4 py-2 border border-[#4A7A63] rounded"
        />

        {/* Date/Time Picker */}
        <input
          type="datetime-local"
          className="w-full px-4 py-2 border border-[#4A7A63] rounded"
        />

        {/* Submit Button */}
        <button
          type="submit"
          className="bg-[#E07A5F] text-[#F4F1DE] px-6 py-2 rounded hover:bg-[#d46653]"
        >
          Submit
        </button>
      </form>
    </div>
  );
}

export default GetQuote;
